import React from "react";
import PropTypes from "prop-types";
import styles from "./TasksList.module.scss";

const TasksList = ({ tasks }) => {
  const compare = (a, b) => {
    return Date.parse(b.date) - Date.parse(a.date);
  };
  const sortedTasks = [...tasks].sort(compare);

  const displayOpenTask = (item) => (
    <div>
      <table>
        <tr>
          <td>1</td> <td>2</td> <td>3</td>
        </tr>
        <tr>
          <td>4</td> <td>5</td> <td>6</td>
        </tr>
        <tr>
          <td>7</td> <td>8</td> <td>9</td>
        </tr>
      </table>
    </div>
  );

  const displayCloseTask = (item) => {};

  const displayBooleanTask = (item) => {};

  return (
    <div className={styles.root}>
      {sortedTasks.map((item) => {
        if (item.taskType == "taskClose") return;
        if (item.taskType == "taskOpen") return;
        if (item.taskType == "taskBoolean") return;
      })}
    </div>
  );
};

TasksList.propTypes = {
  tasks: PropTypes.array.isRequired,
};

export default TasksList;
